// SignIn.js
import React from 'react';

const SignIn = () => {
  return (
    <div>
      <h2>Sign In Page</h2>
      <p>Sign in to access your account.</p>
      <p>Username Area</p>
      <p>Password Area</p>

      <a href="/login"><button type="submit">Login</button></a>

      <a href="/about"><button type="submit">Create Account</button></a>
    </div>
  );
};

export default SignIn;
